import React from 'react'
import './App.css'
import ParticleBackground from 'react-particle-backgrounds'

// eslint-disable-next-line
import { Article, Navbar } from './components'
// eslint-disable-next-line
import {Footer, Home, Projects, Services} from './containers'


const myComponent = () => {

  const settings = {
    particle: {
      particleCount: 35,
      color: "#fff",
      minSize: 1,
      maxSize: 4
    },
    velocity: {
      minSpeed: 0.2,
      maxSpeed: 0.4
    },
    opacity: {
      minOpacity: 0,
      maxOpacity: 0.6,
      opacityTransitionTime: 10000
    }
  }

  return (
    <ParticleBackground settings={settings}/>
  )
}
const App = () => {
  return (
    <div className='App'>
      <div className='gradient__bg'>
        <Navbar/>
        <Home/>
        <myComponent>something</myComponent>
      </div>
      <Projects/>
      <Services/>
      <Footer/>
    </div>
  )
}

export default App
